import ai from '../src/images/ai.svg';
import marketing from '../src/images/marketing.svg';

const Sdata = [
    {
        imgsrc: application,
        title: 'Mobile Application Development Services',
        content: 'Talented pool of developers experienced in building mHealth apps, mobile payment apps, and m-commerce apps'
