    },
    {
        imgsrc: enterprise,
        title: 'Enterprise Application Development Services',
        content: 'You get robust and scalable enterprise app that maximize business growth.'
    },
    {
        imgsrc: marketing,
        title: 'Digital Marketing Services',
        content: 'Thrive works with you to produce customized digital marketing services and a plan that aligns with your unique business needs. We become an extension of your team, a partner that understands your market and goals.'
    }
]

export default Sdata;
